import React from "react"
import playcover from "../static/css/palycover.module.css"
export default function PlayCover(){
    return(
        <Fragment>
            <div className={playcover.wrap}>
                <span className={playcover.cover}></span>
                <span className={playcover.cover}></span>
                <span className={playcover.cover}></span>
            </div>
        </Fragment>
    )
}
